
DROP DATABASE IF EXISTS snet2910;
CREATE DATABASE snet2910;
use snet2910;

drop table if exists users;
CREATE TABLE users(
	id serial primary key, -- SERIAL == BIGINT UNSIGNED NOT NULL AUTO_INCREMENT UNIQUE
	firstname varchar(50),
	lastname varchar(50),
	email varchar(120) UNIQUE,
	phone varchar(20) UNIQUE,
	birthday date,
	hometown varchar(100),
	gender char(1),
	photo_id BIGINT UNSIGNED,
	created_at datetime default now(), -- функция now по умолчанию возвращает дату и время текущего момента
	pass char(30)
);

-- создаем индексы для таблицы users с помощью alter table простой и сложносоставной, для поиска
alter table users add index (phone);
alter table users add index users_firstname_lastname_idx (firstname, lastname);

drop table if exists settings;
CREATE TABLE settings(
	user_id serial primary key,
	can_see enum('all', 'friends_of_friends', 'friends', 'nobody'),
	can_comment enum('all', 'friends_of_friends', 'friends', 'nobody'),
	can_message enum('all', 'friends_of_friends', 'friends', 'nobody'),
	foreign key (user_id) references users(id)
);

drop table if exists messages;
CREATE TABLE messages(
	id serial primary key,
	from_user_id BIGINT UNSIGNED NOT NULL,
	to_user_id BIGINT UNSIGNED NOT NULL,
	message text not null,
	is_read bool default 0,
	created_at datetime default now(),
	foreign key (from_user_id) references users(id), -- внешний ключ к id таблицы users
	foreign key (to_user_id) references users(id)
);

alter table messages add index messages_from_user_id (from_user_id);
alter table messages add index messages_to_user_id (to_user_id);

drop table if exists friend_requests;
CREATE TABLE friend_requests(
	initiator_user_id BIGINT UNSIGNED NOT NULL,
	target_user_id BIGINT UNSIGNED NOT NULL,
	status enum('requested', 'approved', 'unfriended', 'declined'),
	requested_at datetime default now(),
	confirmed_at datetime default current_timestamp on update current_timestamp,
	primary key(initiator_user_id, target_user_id), -- сложносоставной первичный ключ по двум столбцам
	index (initiator_user_id), -- задаем индекс при создании таблицы
	index (target_user_id),
	foreign key (initiator_user_id) references users(id),
	foreign key (target_user_id) references users(id)
);

drop table if exists communities;
CREATE TABLE communities (
	id serial primary key,
	name varchar(150),
	index (name)
);

drop table if exists users_communities;
CREATE TABLE users_communities( -- описывает связь многие ко многим
	user_id BIGINT UNSIGNED NOT NULL,
	community_id BIGINT UNSIGNED NOT NULL,
	primary key (user_id, community_id),
	foreign key (user_id) references users(id),
	foreign key (community_id) references communities(id)
);

drop table if exists posts;
CREATE TABLE posts (
	id serial primary key,
	user_id BIGINT UNSIGNED NOT NULL,
	post text,
	attachments json,
	metadata json,
	created_at datetime default now(),
	updated_at datetime default current_timestamp on update current_timestamp,
	foreign key (user_id) references users(id)
);

drop table if exists comments;
CREATE TABLE comments(
	id serial primary key,
	user_id BIGINT UNSIGNED NOT NULL,
	post_id BIGINT UNSIGNED NOT NULL,
	comment text,
	created_at datetime default now(),
	updated_at datetime default current_timestamp on update current_timestamp,
	foreign key (user_id) references users(id),
	foreign key (post_id) references posts(id)
);

drop table if exists photos;
CREATE TABLE photos(
	id serial primary key,
	filename varchar(255) UNIQUE,
	user_id BIGINT UNSIGNED NOT NULL,
	description text,
	created_at datetime default current_timestamp,
	foreign key (user_id) references users(id)
);

drop table if exists like_photos;
CREATE TABLE like_photos(
	id serial primary key,
	user_id BIGINT UNSIGNED NOT NULL,
	photos_id BIGINT UNSIGNED NOT NULL,
	add_like bool default 0,
	foreign key (user_id) references users(id),
	foreign key (photos_id) references photos(id)
);

drop table if exists like_comments;
CREATE TABLE like_comments(
	id serial primary key,
	user_id BIGINT UNSIGNED NOT NULL,
	comments_id BIGINT UNSIGNED NOT NULL,
	add_like bool default 0,
	foreign key (user_id) references users(id),
	foreign key (comments_id) references comments(id)
);

drop table if exists like_posts;
CREATE TABLE like_posts(
	id serial primary key,
	user_id BIGINT UNSIGNED NOT NULL,
	post_id BIGINT UNSIGNED NOT NULL,
	add_like bool default 0,
	foreign key (user_id) references users(id),
	foreign key (post_id) references posts(id)
);

drop table if exists like_users;
CREATE TABLE like_users(
	id serial primary key,
	user_id BIGINT UNSIGNED NOT NULL,
	target_user_id BIGINT UNSIGNED NOT NULL,
	add_like bool default 0,
	foreign key (user_id) references users(id),
	foreign key (target_user_id) references users(id)
);
















